import React from 'react';
import {VictoryChart,VictoryLine,VictoryPie} from "victory";
import {Heading} from 'evergreen-ui';
const UserDetails = ({user}) => {


    return(
        <div className="graphs">
            <h1 id ='year'>Monthly activity</h1>
            <VictoryChart>
                <VictoryLine
                    data={[
                        { x: "Jan", y: 5 },
                        { x: "Feb", y: 4 },
                        { x: "Mar", y: 3 },
                        { x: "Apr", y: 0 },
                        { x: "May", y: 1 },
                        { x: "Jun", y: 3 },
                        { x: "Jul", y: 5 },
                        { x: "Aug", y: 4 },
                        { x: "Sep", y: 0 },
                        { x: "Oct", y: 1 },
                        { x: "Nov", y: 7 },
                        { x: "Dec", y: 5 }
                        ]}
                />
            </VictoryChart>
            <Heading>Daily activity</Heading>
            <VictoryPie
                colorScale={["#084B8A", "#00783E", "#00783E", "#EFBB35","#234361","#008f68", "#6DB65B"]}
                data={[
                    { x: "Mon", y: 5 },
                    { x: "Tue", y: 4 },
                    { x: "Wed", y: 6 },
                    { x: "Thu", y: 4 },
                    { x: "Fri", y: 3 },
                    { x: "Sat", y: 2 },
                    { x: "Sun", y: 9 }
                    ]}
                    />
        </div>
    )
}
export default UserDetails;
